import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component{
  constructor(){
super();
this.state = {
  monster: [
    {
      name: 'frankenstain',
      id: 'e1'
    },
    {
      name: 'dracula',
      id: 'e2'
    },
    {
      name: 'zombie',
      id: 'e3'
    },
  ]
}
  }
  render(){
    return(
      <div className="App">
     {
       this.state.monster.map(monster => <h1 key={monster.id}>{monster.name}</h1>)
     }
    </div>
    )
  }
}

export default App;
